import React from "react";
import Note from "./Note";

const NoteList = ({ notes, onDelete, onSelect }) => (
  <div className="note-list">
    {notes.map((note) => (
      <Note key={note.id} note={note} onDelete={onDelete} onSelect={onSelect} />
    ))}
  </div>
);

export default NoteList;
